INSERT INTO `documents_templates` (`templateCode`, `templateName`, `templateCompatibility`, `revisionId`, `revisionDate`, `description`, `defaultCategory`, `isRequiredPatientInfo`, `isRequiredEncounter`, `editTemplate`, `viewTemplate`, `printTemplate`, `templateScript`, `isPrintable`, `isNoDefaultHeader`, `isNoDefaultFooter`, `created_by`, `updated_by`, `deleted_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
('cv19-vaccine-administration', 'แบบบันทึกการฉีดวัคซีน COVID19', NULL, '00', '2021-05-10', NULL, '100', 1, 1, '<v-container>\n  <v-row align=\"center\">\n    <v-col cols=\"4\" md=\"2\">\n      <span class=\"text-h6\">Vital signs</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.temperature\" :rules=\"[rules.require(),rules.numeric(),rules.range(30,45)]\" label=\"Temperature\" append=\"°C\"></v-text-field>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.bloodPressureSystolic\" :rules=\"[rules.require(),rules.numeric()]\" label=\"BP Systolic\" append=\"mmHg\"></v-text-field>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.bloodPressureDiastolic\" :rules=\"[rules.require(),rules.numeric()]\" label=\"BP Diastolic\" append=\"mmHg\"></v-text-field>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.height\" :rules=\"[rules.require(),rules.numeric()]\" label=\"Height\" append=\"cm\"></v-text-field>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.weight\" :rules=\"[rules.require(),rules.numeric()]\" label=\"Weight\" append=\"Kg\"></v-text-field>\n    </v-col>\n  </v-row>\n  <v-row>\n    <v-col>\n      <v-text-barcode v-model=\"data.gs1code\" label=\"GS1 Barcode\"></v-text-barcode>\n      <v-gs1-parser v-model=\"data.gs1data\" :item-value=\"data.gs1code\"></v-gs1-parser>\n      <v-hidden-field v-model=\"data.productCode\" :item-value=\"data.gs1data\" :hook=\"(data)=>{return (data.productCode) ? data.productCode : undefined}\"></v-hidden-field>\n      <v-hidden-field v-model=\"data.lotNo\" :item-value=\"data.gs1data\" :hook=\"(data)=>{return (data.lotNo) ? data.lotNo : undefined}\"></v-hidden-field>\n      <v-hidden-field v-model=\"data.serialNo\" :item-value=\"data.gs1data\" :hook=\"(data)=>{return (data.serialNo) ? data.serialNo : undefined}\"></v-hidden-field>\n      <v-hidden-field v-model=\"data.expDate\" :item-value=\"data.gs1data\" :hook=\"(data)=>{return (data.expDate) ? data.expDate : undefined}\"></v-hidden-field>\n      <v-hidden-field v-model=\"data.adminDateTime\" :item-value=\"data.gs1data\" :hook=\"(data)=>{return (data.scanDateTime) ? data.scanDateTime : undefined}\" v-if=\"!data.adminDateTime\"></v-hidden-field>\n    </v-col>\n  </v-row>\n  <v-row>\n    <v-col cols=\"12\" md=\"8\">\n      <v-master-field v-model=\"data.productCode\" groupKey=\"covid19Vaccine\" label=\"ชนิดวัคซีน\" :rules=\"[rules.require()]\"></v-master-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-date-time-field v-model=\"data.adminDateTime\" label=\"วันที่ฉีด\" :rules=\"[rules.require()]\"></v-date-time-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.lotNo\" label=\"Lot No.\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.serialNo\" label=\"Serial No.\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.expDate\" label=\"Expiry date\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-master-field v-model=\"data.adminRoute\" groupKey=\"covid19VaccineAdminRoute\" label=\"Route\" :rules=\"[rules.require()]\"></v-master-field>\n      <v-hidden-field v-model=\"data.adminRoute\" :item-value=\"data.adminRoute\" :hook=\"(route)=>{return (route) ? route : \'IM\'}\"></v-hidden-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-master-field v-model=\"data.adminSite\" groupKey=\"covid19VaccineAdminSite\" label=\"ตำแหน่งที่ฉีดยา\"></v-master-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.adminSiteOther\" label=\"ตำแหน่งอื่นๆ\"></v-text-field>\n    </v-col>\n  </v-row>\n</v-container>', '<v-container>\n  <v-row align=\"center\">\n    <v-col cols=\"4\" md=\"2\">\n      <span class=\"text-h6\">Vital signs</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.temp\" :rules=\"[rules.require(),rules.numeric(),rules.range(30,45)]\" label=\"Temperature\" append=\"°C\"></v-text-field>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.SBP\" :rules=\"[rules.require(),rules.numeric()]\" label=\"BP Systolic\" append=\"mmHg\"></v-text-field>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.DBP\" :rules=\"[rules.require(),rules.numeric()]\" label=\"BP Diastolic\" append=\"mmHg\"></v-text-field>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.high\" :rules=\"[rules.require(),rules.numeric()]\" label=\"Height\" append=\"cm\"></v-text-field>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-text-field v-model=\"data.BW\" :rules=\"[rules.require(),rules.numeric()]\" label=\"Weight\" append=\"Kg\"></v-text-field>\n    </v-col>\n  </v-row>\n  <v-row>\n    <v-col>\n      <v-text-barcode v-model=\"data.gs1code\" label=\"GS1 Barcode\"></v-text-barcode>\n    </v-col>\n  </v-row>\n  <v-row>\n    <v-col cols=\"12\" md=\"8\">\n      <v-master-field v-model=\"data.productCode\" groupKey=\"covid19Vaccine\" label=\"ชนิดวัคซีน\" :rules=\"[rules.require()]\"></v-master-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-date-time-field v-model=\"data.adminDateTime\" label=\"วันที่ฉีด\" :rules=\"[rules.require()]\"></v-date-time-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.lotNo\" label=\"Lot No.\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.serialNo\" label=\"Serial No.\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.expDate\" label=\"Expiry date\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-master-field v-model=\"data.adminRoute\" groupKey=\"covid19VaccineAdminRoute\" label=\"Route\" :rules=\"[rules.require()]\"></v-master-field>\n      <v-hidden-field v-model=\"data.adminRoute\" :item-value=\"data.adminRoute\" :hook=\"(route)=>{return (route) ? route : \'IM\'}\"></v-hidden-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-master-field v-model=\"data.adminSite\" groupKey=\"covid19VaccineAdminSite\" label=\"ตำแหน่งที่ฉีดยา\"></v-master-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.adminSiteOther\" label=\"ตำแหน่งอื่นๆ\"></v-text-field>\n    </v-col>\n  </v-row>\n</v-container>', NULL, NULL, 0, 0, 0, '1100699000502', NULL, NULL, NULL, '2021-05-10 05:08:37', '2021-05-10 05:08:37'),
('cv19-vaccine-adverseevents', 'แบบสอบถามเหตุการณ์ไม่พึงประสงค์', NULL, '00', '2021-05-10', NULL, '100', 1, 1, '<v-container fluid>\n  <v-row>\n    <v-col cols=\"12\" md=\"8\">\n      <v-master-field v-model=\"data.productCode\" groupKey=\"covid19Vaccine\" label=\"ชนิดวัคซีน\" :rules=\"[rules.require()]\"></v-master-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-date-time-field v-model=\"data.adminDateTime\" label=\"วันที่ฉีด\" :rules=\"[rules.require()]\"></v-date-time-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.lotNo\" label=\"Lot No.\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.serialNo\" label=\"Serial No.\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.expDate\" label=\"Expiry date\" :rules=\"[rules.require()]\"></v-text-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-master-field v-model=\"data.adminRoute\" groupKey=\"covid19VaccineAdminRoute\" label=\"Route\" :rules=\"[rules.require()]\"></v-master-field>\n      <v-hidden-field v-model=\"data.adminRoute\" :item-value=\"data.adminRoute\" :hook=\"(route)=>{return (route) ? route : \'IM\'}\"></v-hidden-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-master-field v-model=\"data.adminSite\" groupKey=\"covid19VaccineAdminSite\" label=\"ตำแหน่งที่ฉีดยา\"></v-master-field>\n    </v-col>\n    <v-col cols=\"12\" md=\"4\">\n      <v-text-field v-model=\"data.adminSiteOther\" label=\"ตำแหน่งอื่นๆ\"></v-text-field>\n    </v-col>\n  </v-row>\n  <v-row>\n    <v-col cols=\"6\">\n      <v-date-field v-model=\"data.reportDate\" label=\"วันที่รายงานเหตุการณ์\"></v-date-field>\n    </v-col>\n    <v-col cols=\"6\">\n      <v-date-field v-model=\"data.symptomDate\" label=\"วันที่เกิดเหตุการณ์\"></v-date-field>\n    </v-col>\n  </v-row>\n    <v-row dense>\n    <v-col cols=\"12\">\n      <span class=\"body-1\">เหตุการณ์ไม่พึงประสงค์ทั่วไปหรือไม่ร้ายแรง</span>\n    </v-col>\n  </v-row>\n  <v-row dense>\n    <v-col cols=\"12\">   \n      <v-checkbox v-model=\"data.isSymptomMildFever\" label=\"ไข้ต่ำ ๆ หรือ ปวดศีรษะ\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildInflammation\" label=\"ปวด/บวม/แดง/ร้อน/คัน บริเวณที่ฉีด\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildFatique\" label=\"อ่อนเพลีย/ไม่มีแรง\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildMalaise\" label=\"ไม่สบายตัว ปวดเมื่อย\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildNausea\" label=\"คลื่นไส้ อาเจียน ไม่เกิน 5 ครั้ง\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildRash\" label=\"ผื่นแดงเล็กน้อย\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildOthers\" label=\"อาการผิดปกติอื่น ๆ\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-text-field v-model=\"data.isSymptomMildOthersDetail\" label=\"ระบุอื่นๆ\" hide-details class=\"ml-12\" v-if=\"data.isSymptomMildOthers\"></v-text-field>\n    </v-col>\n  </v-row>\n  <v-row>\n    <v-col cols=\"12\">\n      <span class=\"body-1\">เหตุการณ์ไม่พึงประสงค์ ที่ต้องรีบไปพบแพทย์ที่โรงพยาบาล</span>\n    </v-col>\n  </v-row>\n  <v-row dense>\n    <v-col cols=\"12\">  \n      <v-checkbox v-model=\"data.isSymptomSevereFever\" label=\"ไข้สูง หนาวสั่น ปวดศีรษะรุนแรง\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereDyspnea\" label=\"เหนื่อย แน่นหน้าอก หายใจไม่สะดวก หรือ หายใจไม่ออก\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereVomitting\" label=\"อาเจียน มากกว่า 5 ครั้ง\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereRash\" label=\"ผื่นขึ้นทั้งตัว ผิวหนังลอก\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereEcchymosis\" label=\"มีจุด (จ้ำ) เลือดออกจำนวนมาก\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereFacialPalsy\" label=\"ใบหน้าเบี้ยว หรือ ปากเบี้ยว\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereWeakness\" label=\"แขนขาอ่อนแรง กล้ามเนื้ออ่อนแรง ไม่สามารถทรงตัวได้\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereSeizure\" label=\"ชัก หรือ หมดสติ\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereOthers\" label=\"อาการผิดปกติอื่น ๆ\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-text-field v-model=\"data.isSymptomSevereOthersDetail\" label=\"ระบุอื่นๆ\" hide-details class=\"ml-12\" v-if=\"data.isSymptomSevereOthers\"></v-text-field>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\">\n      <span :class=\"(data.isSymptomAffectDailyLife) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">อาการไม่พึงประสงค์ที่เกิดขึ้น ส่งผลกระทบต่อการดำเนินชีวิตประจำวันของท่านหรือไม่</span>\n    </v-col>\n    <v-col cols=\"4\">\n      <v-radio-group v-model=\"data.isSymptomAffectDailyLife\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\">\n      <span :class=\"(data.isSymptomVisitDoctor) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">เมื่อเกิดอาการไม่พึงประสงค์แล้ว ท่านไปพบแพทย์หรือไม่</span>\n    </v-col>\n    <v-col cols=\"4\">\n      <v-radio-group v-model=\"data.isSymptomVisitDoctor\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n</v-container>', NULL, NULL, NULL, 0, 0, 0, '1100699000502', NULL, NULL, NULL, '2021-05-10 05:13:49', '2021-05-10 05:13:49'),
('cv19-vaccine-consent', 'COVID19 Vaccination Consent Form', NULL, '00', '2021-05-10', NULL, '100', 1, 1, '<v-container fluid>\n  <v-row align=\"center\">\n    <v-col>\n      <span class=\"title\">โปรดตอบคำถามต่อไปนี้</span>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isAgeUnder18) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณมีอายุต่ำกว่า 18 ปี</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isAgeUnder18\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isAllergyToVaccine) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณเคยมีประวัติแพ้วัคซีน หรือ แพ้ยา หรือ ส่วนประกอบของวัคซีน อย่างรุนแรง</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isAllergyToVaccine\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isRecentPlasmaTransfusion) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณเคยได้รับการถ่ายเลือด พลาสมา ผลิตภัณฑ์จากเลือด ส่วนประกอบของเลือด อิมมูโนโกลบูลิน ยาต้านไวรัส หรือ แอนติบอดีสำหรับการรักษาโควิด-19 ภายใน 90 วันที่ผ่านมา</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isRecentPlasmaTransfusion\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isRecentCovid19Positive) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณได้ตรวจพบเชื้อโควิด 19 ในช่วง 10 วันที่ผ่านมา</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isRecentCovid19Positive\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isUnstableComorbid) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณมีโรคประจำตัวที่อาการยังไม่คงที่ ไม่สามารถควบคุมอาการของโรคได้ เช่น เจ็บแน่นหน้าอก หอบ เหนื่อย ใจสั่น เป็นต้น</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isUnstableComorbid\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isNeurologicalSymptom) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณมีอาการเกี่ยวกับสมอง หรือ ระบบประสาทอื่น ๆ</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isNeurologicalSymptom\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isPregnancyLactation) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณอยู่ระหว่างตั้งครรภ์ หรือ ให้นมบุตร หรือ วางแผนที่จะตั้งครรภ์</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isPregnancyLactation\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isImmunocompromised) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">ผู้ที่มีภาวะภูมิคุ้มกันบกพร่อง หรือ ได้รับยากดภูมิคุ้มกัน</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isImmunocompromised\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isBleedingDisorder) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">มีภาวะเลือดออกง่ายหรือหยุดยาก เกล็ดเลือดต่ำ การแข็งตัวของเลือดผิดปกติ หรือ ได้รับยาต้านการแข็งตัวของเลือด</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isBleedingDisorder\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isRecentHospitalization) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณมีอาการเจ็บป่วยเฉียบพลัน หรือ นอนรักษาตัวและออกจากโรงพยาบาลไม่เกิน 14 วัน</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isRecentHospitalization\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"8\" md=\"10\">\n      <span :class=\"(data.isCurrentSickness) ? \'blue--text text--darken-3 font-weight-bold body-1\' : \'body-1\'\">คุณกำลังมีอาการป่วย เช่น มีไข้ หนาวสั่น หายใจลำบาก อ่อนเพลียกล้ามเนื้อ เป็นต้น</span>\n    </v-col>\n    <v-col cols=\"4\" md=\"2\">\n      <v-radio-group v-model=\"data.isCurrentSickness\" :rules=\"[rules.require(\'จำเป็นต้องเลือก\')]\" row hide-details class=\"ma-0\">\n        <v-radio label=\"ไม่ใช่\" :value=\"false\"></v-radio>\n        <v-radio label=\"ใช่\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row align=\"center\">\n    <v-col cols=\"12\">\n      <template v-if=\"data.covid19VaccineRisk==\'eligible\'\">\n        <span class=\"green--text text--darken-3 font-weight-bold body-1\">ท่านสามารถเข้ารับบริการฉีดวัคซีนได้</span>\n      </template>\n      <template v-else>\n        <span class=\"orange--text text--darken-3 font-weight-bold body-1\">ท่านความเสี่ยง หรือมีภาวะที่ไม่เหมาะสมกับการฉีดวัคซีน โปรดติดต่อเจ้าหน้าที่</span>\n      </template>\n      <v-hidden-field v-model=\"data.covid19VaccineRisk\" :hook=\"computeCovid19VaccineRisk\" :itemValue=\"data\"></v-hidden-field>\n    </v-col>\n  </v-row>\n</v-container>', NULL, '/templates/cv19-vaccine-consent.00.docx', '{\n  methods: {\n    computeCovid19VaccineRisk() {\n      let items = Object.keys(this.data)\n      let result = false\n      items.forEach((key)=>{\n        if (key.startsWith(\'is\')) result = result || this.data[key]\n      })\n      return (result) ? \"non-eligible\" : \"eligible\"\n    }\n  }\n}', 1, 0, 0, '1100699000502', NULL, NULL, NULL, '2021-05-10 05:14:36', '2021-05-10 05:14:36'),
('cv19-vaccine-discharge', 'COVID19 Discharge Note', NULL, '00', '2021-05-10', NULL, '100', 1, 1, '<v-container fluid>\n  <v-row dense>\n    <v-col cols=\"12\"><span class=\"body-1\">แบบประเมินสังเกตอาการ 30 นาทีหลังฉีดวัคซีน</span></v-col>\n    <v-col cols=\"12\">\n      <v-radio-group v-model=\"data.isSymptomAfterVaccine\" hide-details class=\"ma-0\" @change=\"cleanup\">\n        <v-radio label=\"ไม่มีอาการผิดปกติ\" :value=\"false\"></v-radio>\n        <v-radio label=\"มีอาการผิดปกติ\" :value=\"true\"></v-radio>\n      </v-radio-group>\n    </v-col>\n  </v-row>\n  <v-row dense>\n    <v-col cols=\"12\" v-if=\"data.isSymptomAfterVaccine\">   \n      <v-checkbox v-model=\"data.isSymptomMild\" label=\"อาการข้างเคียงที่ไม่รุนแรง\" hide-details class=\"ml-6\"></v-checkbox>\n    </v-col>\n  </v-row>\n  <v-row dense>\n    <v-col cols=\"12\" v-if=\"data.isSymptomMild\">   \n      <v-checkbox v-model=\"data.isSymptomMildFever\" label=\"ไข้ต่ำ ๆ หรือ ปวดศีรษะ\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildInflammation\" label=\"ปวด/บวม/แดง/ร้อน/คัน บริเวณที่ฉีด\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildFatique\" label=\"อ่อนเพลีย/ไม่มีแรง\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildMalaise\" label=\"ไม่สบายตัว ปวดเมื่อย\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildNausea\" label=\"คลื่นไส้ อาเจียน ไม่เกิน 5 ครั้ง\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildRash\" label=\"ผื่นแดงเล็กน้อย\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomMildOthers\" label=\"อาการผิดปกติอื่น ๆ\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-text-field v-model=\"data.isSymptomMildOthersDetail\" label=\"ระบุอื่นๆ\" hide-details class=\"ml-12\" v-if=\"data.isSymptomMildOthers\"></v-text-field>\n    </v-col>\n  </v-row>\n  <v-row dense>\n    <v-col cols=\"12\" v-if=\"data.isSymptomAfterVaccine\">   \n      <v-checkbox v-model=\"data.isSymptomSevere\" label=\"อาการข้างเคียงที่รุนแรง\" hide-details class=\"ml-6\"></v-checkbox>\n    </v-col>\n  </v-row>\n  <v-row dense>\n    <v-col cols=\"12\" v-if=\"data.isSymptomSevere\">  \n      <v-checkbox v-model=\"data.isSymptomSevereFever\" label=\"ไข้สูง หนาวสั่น ปวดศีรษะรุนแรง\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereDyspnea\" label=\"เหนื่อย แน่นหน้าอก หายใจไม่สะดวก หรือ หายใจไม่ออก\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereVomitting\" label=\"อาเจียน มากกว่า 5 ครั้ง\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereRash\" label=\"ผื่นขึ้นทั้งตัว ผิวหนังลอก\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereEcchymosis\" label=\"มีจุด (จ้ำ) เลือดออกจำนวนมาก\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereFacialPalsy\" label=\"ใบหน้าเบี้ยว หรือ ปากเบี้ยว\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereWeakness\" label=\"แขนขาอ่อนแรง กล้ามเนื้ออ่อนแรง ไม่สามารถทรงตัวได้\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereSeizure\" label=\"ชัก หรือ หมดสติ\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-checkbox v-model=\"data.isSymptomSevereOthers\" label=\"อาการผิดปกติอื่น ๆ\" hide-details class=\"ml-12\"></v-checkbox>\n      <v-text-field v-model=\"data.isSymptomSevereOthersDetail\" label=\"ระบุอื่นๆ\" hide-details class=\"ml-12\" v-if=\"data.isSymptomSevereOthers\"></v-text-field>\n    </v-col>\n  </v-row>\n</v-container>', NULL, NULL, '{\n  methods: {\n    cleanup(isSymptom) {\n      if (!isSymptom) {\n        let items = Object.keys(this.data)\n      	let result = false\n      	items.forEach((key)=>{\n        	if (key.startsWith(\'is\')) this.data[key] = false\n      	})\n      }\n    }\n  }\n}', 0, 0, 0, '1100699000502', NULL, NULL, NULL, '2021-05-10 05:15:32', '2021-05-10 05:15:32'),
