('$UserPosition', 'ตำแหน่งหน้าที่', 'ตำแหน่งหน้าที่ของผู้ใช้งาน', '<v-table-field v-model=\"data.defaultRoles\" title=\"Default Roles\" item-key=\"roleId\" :headers=\"[{text: \'Role ID\',value: \'roleId\',class: \'body-2\'},{text: \'Role Name\',value: \'roleName\',class: \'body-2\'},]\" hide-toolbar show-create-pad auto-item-action>\n  <template v-slot:createPad=\"{data: tmplData,rules}\">\n    <v-container fluid pa-0>\n      <v-row>\n        <v-col cols=\"12\">\n          <v-master-field :rules=\"[rules.require()]\" v-model=\"tmplData.roleId\"\n            :custom-api=\"[\'models\',\'User\',\'Roles\',\'query\']\" \n            custom-api-text=\"roleName\" custom-api-value=\"roleId\" \n            label=\"Roles\" \n            customApiEagerLoad show-code>\n          </v-master-field>\n        </v-col>\n      </v-row>\n    </v-container>\n  </template>\n  <template v-slot:item.roleName=\"props\">\n    <v-label-api :api-url=\"[\'models\',\'User\',\'Roles\',\'find\']\" :api-key=\"props.item.roleId\" api-field=\"roleName\" ></v-label-api>\n  </template>\n</v-table-field>', '{\"defaultRoles\": []}', NULL, NULL, NULL, NULL, NULL, NULL),
('covid19Vaccine', 'COVID19 Vaccine', NULL, '<v-text-field label=\"Vaccine Total Dose\" v-model=\"data.vaccine_total_dose\" type=\"number\"></v-text-field>\n<v-text-field label=\"Vaccine Interval\" v-model=\"data.vaccine_interval\" type=\"number\"></v-text-field>\n<v-text-field label=\"MOPH Vaccine Code\" v-model=\"data.moph_vaccine_code\"></v-text-field>\n<v-text-field label=\"MOPH Vaccine Name\" v-model=\"data.moph_vaccine_name\"></v-text-field>\n<v-text-field label=\"MOPH Vaccine Manufacturer\" v-model=\"data.moph_vaccine_manufacturer\"></v-text-field>', NULL, '1100699000502', NULL, NULL, NULL, '2021-05-10 05:18:23', '2021-05-10 05:18:23'),
